import React, {Component} from "react"
import CheckoutBasketTableRow from "./CheckoutBasketTableRow";

export default class CheckoutBasketTable extends Component
{
    render()
    {
        return (
            <table>
                <thead>
                <tr>
                    <th>Model</th>
                    <th>Colour</th>
                    <th>Year</th>
                    <th>Price</th>
                    <th>Photos</th>
                    <th> </th>
                </tr>
                </thead>

                <tbody>
                {this.props.cart.map((cart) => <CheckoutBasketTableRow key={cart._id} cart={cart}/>)}
                </tbody>
            </table>
        )
    }
}
